import { Select } from "antd";
import { useNavigate } from "react-router-dom";

function AdminNavBar(){
    const {Option} = Select;
    const navigate = useNavigate();
    const handleChange = (value)=>{
        navigate(`${value}`);
    }

    return(
        <div>
            <Select defaultValue='userMenegment' onChange={handleChange}>
                <Option value='userBlocking'>Blocking</Option>
                <Option value='orderStatusChange'>Change order status</Option>
            </Select>
            <Select>
                <Option value='usersByBirthday'>Get users by birthday</Option>
                <></>
            </Select>
        </div>
    )
}
export default AdminNavBar;
